import React, { useState } from "react";

const Appbg = () => {

const color = "#ff0000";
const [bg, setBg] = useState(color);

const bgChange = () => {

    let newBg = "#800080";
    setBg(newBg);

};

const secBgChange = () => {
    
    setBg(bg);
};

return (
    <>
    <div style={{backgroundColor: bg}}> 
    <button onClick={bgChange} onDoubleClick={secBgChange}>click</button>
    </div>

    </>

);

};
export default Appbg;
